return {
	["Hello, hello. Have you already acquired all the items I requested?"] = "Witam witam. Czy zdobyles juz wszystkie przedmioty, o ktore prosilem?",
	["Thanks. I'm heading for the casting soon. Here's your reward, my pickaxe."] = "Dzieki. Zaraz sie zwijam na casting. A oto twoja nagroda, moj kilof.",
	["Come back when you've collected all the items."] = "Wroc, jak zdobedzaiesz juz wszystkie przedmioty.",
	["My career as a TV fortune teller was going well. Some time ago, I took out a loan to start my own business, which turned out to be a scam, of course. I went to the turf accountant and bet on RKS Huwdu winning. Those failures of a human decided to lose, and I ended up with a payday loan with 69% interest! The deadline for the first loan installment is approaching. I don't want the bailiff to seize my house. Try asking Moustachilles about my problem. They always manage to avoid the law and responsibility."] = "Moja kariera telewizyjnego wrozbity szla najbardziej pomyslnie. Jakis czas temu wzialem kredyt na otworzenie wlasnej dzialanosci, co oczywiscie bylo sciema. Poszedlem do bukmachera i obstawilem wygrana rks huwdu. Ci nieudacznicy postanowili przegrac, a ja zostalem z chwilowka oprocentowana na 69%! Termin splaty pierwszej raty kredytu zaraz uplywa. Nie chce zeby komornik mi zajal dom. Sprobuj zapytac Andrzeja Wasacza o moj problem, oni zawsze jakos unikaja prawa i odpowiedzialnosci.",
	["Thanks for your help. Now I'll be able to set up my office properly. Please take my mining helmet as a reward. As for the costs, I didn't expect such a high amount. I only have 70 platinum with me. I'll try to cover the rest in the future."] = "Dzieki za pomoc, teraz bede mogl zrobic urzad w chuja. Prosze wez moj helm gorniczy jako nagrode. Jezeli chodzi o koszty, to nie spodziewalem sie tak wysokiej kwoty. Mam przy sobie tylko 70 platynek. Reszte postaram sie pokryc w przyszlosci.",
	["Don't you have a new document for me yet? I'll wait then."] = "Nie masz jeszcze dla mnie nowego dokumentu? W takim razie bede czekac.",
	["You still need to help me with one more thing. I accidentally burned my cover, and the officials will seize my house soon. For financial scams, evading the authorities and other frauds, I'll get at least 15 years. I'm too old for that. I won't even survive that long. I thought about escaping from this continent. Somewhere in the desert, deep underground, I parked my steamboat. It was a long time ago, so I don't remember where the entrance to the cave is where I keep the steam engine. All I remember is that the entrance is boarded up. Just find that place and come back to me to mark it on the map."] = "Musisz mi pomoc jeszcze z jedna rzecza. Mianowicie spalilem swoja przykrywke i zaraz urzednicy zajma mi dom. Za machlojki finansowe, ukrywanie sie przed psami i inne oszustwa dostane co najmniej 15 lat. Jestem na to za stary. Ja nawet nie tyle nie dozyje. Wpadlem na pomysl, zeby uciec z tego kontynentu. Gdzies na pustyni, w glebokich podziemiach zaparkowalem swoj parostatek. To bylo dawno temu, wiec nie pamietam gdzie jest wejscie do jaskini, w ktorej trzymam parowoz. Jedyne co mi swita, to ze {wejscie} jest zabite deskami. Wystarczy ze znajdziesz to miejsce, i wrocisz do mnie, aby mi je wskazac na mapie.",
	["Come to think of it, I might have encountered some gargoyles while exploring around the cave."] = "Jak tak pomyslalem, to mozliwe, ze gdy przemierzalem okolice jaskini, to napotkalem jakies gargoyle.",
	["Are you sure that's the place? All right, here are the keys to my mole. I don't remember where I parked it, but actually, any mole will do. One more thing: I heard that my travel companion, Gandalf, is still alive. We used to steal from a certain library where we found a prophecy about the resurrection of the Crypt King. If that moment ever comes, I think Gandalf will count on the help of the bravest warriors like you. If you want to befriend him, it's worth remembering this secret passphrase: {aside from that people}. Meanwhile, I'm heading out of here. Goodbye."] = "Jestes pewien ze to wlasnie tam? No dobra, oto klucze do mojego kreta. Nie wiem gdzie go zaparkowalem, ale wlasciwie to wystarczy, ze znajdziesz dowolnego innego kreta.\n\nJeszcze jedno: dowiedzialem sie, ze moj wspoltowarzysz podrozy - Gandalf - zyje. Niegdys rabowalismy zbiory pewnej biblioteki, w ktorej znalezlismy przepowiednie, ktora mowila o ponownym powstaniu krola krypty. Jezeli ten moment kiedys nastapi, to mysle gandalf bedzie liczyc na pomoc najdzielniejszych wojownikow, takich jak ty. Jezeli bedziesz chcial sie z nim zaprzyjaznic to warto, zebys zapamietal to tajne haslo: {oprocz tego ludzie}.\n\nTymczasem ja sie stad zawijam, elo.",
	["Found, not stolen. But due to our acquaintance, I can return what I took from Gandalf. Here's his camo backpack that I couldn't open. I won't lie, I'd like to know what's inside. Besides that, I have some stuff from WotE and this strange bag."] = "Znalezione nie kradzione. No ale ze wzgledu na nasza znajomosc moge oddac Ci to co zabralem Gandalfowi. Masz tu jego plecak moro, ktorego nie moglem otworzyc. Nie bede sciemniac, chcialbym wiedziec co w nim jest. Oprocz tego mam jeszcze jakis syf z WotE oraz ten dziwny worek.",
	["In this bag i kept an item from the WotE quest. I completed it on the *REDACTED* server. Do you remember was item it was?"] = "W tym worku trzymalem item z WotE, ktorego robilem na... no tym serwerze, gdzie gm nie trafial banem. Pamietasz jak nazywal sie ten item?",
	["Right, it was the Elite Draken Helmet. Here's your reward."] = "Racja, to byl Elite Draken Helmet. Prosze, oto twoja nagroda",
	["Right, it was the Royal Draken Mail. Here's your reward."] = "Racja, to byl Royal Draken Mail. Prosze, oto twoja nagroda",
	["Right, it was the Royal Scale Robe. Here's your reward."] = "Racja, to byl Royal Scale Robe. Prosze, oto twoja nagroda",
	["Lost the bag? Come back when you retrieve it."] = "Zgubiles worek? Wroc jak go odzyskasz.",
	["Moustachilles has its bandit shithole located on east of mirkotown."] = "Andrzej Wasacz ma swoja meline na wschod od mirkotown.",
	["Yeah, its our key."] = "Tak wlasnie brzmi nasze haslo.",
	["Identity Document"] = "Dokument tozsamosci",
	["SURNAME\n\nBeefbottom\nNAME\nJohn\n\nCITIZENSHIP\nBoland\n\nFAMILY NAME\nAssman\n\nPARENTS NAMES\nAdam Eevee\n\nDate of Birth\n4.20.1969"] = "NAZWISKO\nMieczochlast\n\nIMIE\nJan\n\nOBYWATELSTWO\nBolzgie\n\nNAZWISKO RODOWE\nMieczochlast\n\nIMIONA RODZICOW\nJacek Barbara\n\nDATA URODZENIA\n4.20.1969",
	["This bag is sealed with the power of light. Gandalf is the only one who can reach into it."] = "Torba Gandalfa zapieczetowana magia swiatlosci. Tylko gandalf moze do niej siegnac.",
	["This just might be the place Chester was talking about"] = "To chyba jest miejsce, o ktorym mowil Czeslaw",
	["Chester's house is vacant right now. Therefore it would be impolite to tresspass."] = "Mieszkanie Czeslawa jest puste, a niekulturalne jest krecenie sie tutaj pod nieobecnosc wlasciciela.",
	-- Chester the Dwarf
	["Chester the Dwarf"] = "Czeslaw Krasnolud",
	["Fortune Teller 3000"] = "Wrozbita 3000",
	["You agreed to help Chester become a TV fortune teller. He will need the following items for his profession: Magic Light Wand, Empty Goldfish Bowl, Magician's Robe, Life Crystal."] = "Zgodziles sie pomoc Czeslawowi w zostaniu telewizyjnym wrozbita. Do swojego zawodu bedzie potrzebowac: Magic Light Wand, Empty Goldfish Bowl i Magician's Robe, Life Crystal.",
	["Chester the Dwarf has become a fortune teller, and you received his pickaxe as a reward."] = "Czeslaw krasnolud zostal wrozbita, a ty dostales w nagrode jego kilof.",
	["Chester the Turf Accountant"] = "Bukmacherka czeska",
	["You helped Chester the Dwarf with his TV fortune teller career. Ask him later if he needs help in another field."] = "Pomogles Czeslawowi krasnoludowi z jego kariera telewizyjnego wrozbity, zapytaj go za jakis czas, czy nie potrzebuje pomocy w innej dziedzinie.",
	["Chester the Dwarf entrusted you with a very discreet task. Obtain a new set of documents for him. He directed you to Moustachilles, the leader of the bandits at the camp near Mirkotown."] = "Czeslaw Krasnolud powierzyl ci bardzo dyskretne zadanie. Zdobadz dla niego nowy zestaw dokumentow. Pokierowal cie do Andrzeja Wasacza, przywodcy bandytow z obozu nieopodal Mirkotown.",
	["You obtained the documents from Ornuld. Now, deliver them to Chester the Dwarf."] = "Wyrobiles dokumenty u Ornulda, teraz zanies je do Czeslawa Krasnoluda.",
	["You acquired new documents for Chester the Dwarf, and he rewarded you for it."] = "Zdobyles nowe dokumenty dla Czeslawa Krasnoluda, za co cie nagrodzil.",
	["Mirko Train Simulator"] = "Mirko Train Simulator",
	["You helped Chester the Dwarf change his identity. Ask him later if he needs help in another field."] = "Pomogles Czeslawowi krasnoludowi w zmianie tozsamosci, zapytaj go za jakis czas, czy nie potrzebuje pomocy w innej dziedzinie.",
	["Chester the Dwarf wants to sail away from the continent on his steamship. Find the entrance to the shaft leading to his ship."] = "Czeslaw Krasnolud chce spierdolic z kontynentu swoim parostatkiem. Znajdz wejscie do szybu, ktory prowadzi do jego statku.",
	["You found the cave that Chester the Dwarf was looking for. Now, return to him with the good news."] = "Znalazles jaskinie, ktorej szukal Czeslaw Krasnolud. Wroc teraz do niego z dobra informacja.",
	["You helped Chester the Dwarf with his life problems. He has started packing to begin anew far, far away from here."] = "Pomogles Czeslawowi Krasnoludowi z jego problemami w zyciu. Teraz zaczal sie pakowac, aby rozpoczac wszystko od nowa gdzies daleko, daleko stad.",
	["Business Class to the Labour Exchange"] = "Biznes klasa do posredniaka",
	["Chester the Dwarf has disappeared from the continent. Or has he? Maybe he hasn't managed to start the steamship underground yet. If possible, catch up to him and stop him."] = "Czeslaw Krasnolud spierdolil z kontynentu. Czyzby? Moze jeszcze nie udalo mu sie odpalic parostatku w podziemiach. Jezeli to mozliwe, to go dogon i zatrzymaj.",
	["Chester gave you Gandalf's lost item. Now, return to the mighty wizard and return his property."] = "Czeslaw oddal ci zgube Gandalfa. Wroc teraz do poteznego maga i zwroc mu jego wlasnosc.",
	["Gandalf rewarded you for recovering his bag."] = "Gandalf nagrodzil cie za odzyskanie jego worka.",
}
